      "excerpt": "<h2 id=\"泛型\"><a class=\"header-anchor\" href=\"#泛型\">#</a> 泛型</h2>\n<blockquote>\n<p>泛型就相当于标签</p>\n</blockquote>\n<p>形式：<code>&lt;&gt;</code></p>\n<div class=\"custom-block tip\"><p class=\"custom-block-title\">提示</p>\n<p>集合容器类在设计阶段/声明阶段不能确定这个容器到底实际存什么类型的对象，所以在 JDK1.5 之前只能把元素类型设计为<code>Object</code>，JDK1.5 之后使用泛型来解决。因为这个时候除了元素类型不确定，其他的部分是确定的，因此此时把元素的类型设计成一个参数，这个类型参数叫做<strong>泛型</strong></p>\n<p><code>Collection&lt;E&gt;，List&lt;E&gt;，ArrayList&lt;E&gt;</code>这个<code>&lt;E&gt;</code>就是类型参数，即泛型。</p>\n</div>\n",
