      "excerpt": "<h2 id=\"反射\"><a class=\"header-anchor\" href=\"#反射\">#</a> 反射</h2>\n<blockquote>\n<p>反射机制是在<kbd>运行状态</kbd>中，对于任意一个类，都能够知道这个类的所有属性和方法；对于任意一个对象，都能够调用它的任意方法和属性；这种动态获取信息以及动态调用对象方法的功能成为<code>java</code>的反射机制。</p>\n<p>在编译后产生的字节码文件时，类加载器子系统通过二进制字节流，负责从文件系统加载<code>class</code>文件。在执行<code>java.exe</code>程序的时候，将字节码文件读入 JVM 中 --&gt; <kbd>这个过程叫类的加载</kbd>。</p>\n<p>然后在内存中对应创建一个<code>java.lang.Class</code>对象 -&gt; 这个对象会被放入字节码信息中，这个<code>Class</code>对象，就对应加载那个字节码信息，这个对象被作为程序访问方法区中的这个类的各种数据的外部接口。</p>\n<p>所以，通过这个对象看到的类的结构，我们形象的称反射这种“看透”类的能力，被称之为&quot;introspection&quot;(内省、内观、反省)。</p>\n</blockquote>\n<div class=\"custom-block tip\"><p class=\"custom-block-title\">提示</p>\n<p>说明：在运行期间，如果我们要产生某个类的对象，Java 虚拟机(JVM)会检查该类型的 Class 对象是否已被加载。如果没有被加载，JVM 会根据类的名称找到<code>.class</code>文件并加载它。一旦某个类型的<code>Class</code>对象已被加载到内存，可以用它来产生该类型的所有对象。</p>\n</div>\n",
