      "excerpt": "<p align=\"center\"><h1>MyBatis</h1></p>\n<h2 id=\"简介\"><a class=\"header-anchor\" href=\"#简介\">#</a> 简介</h2>\n<ul>\n<li>\n<p>MyBatis 是一款优秀的<strong>持久层框架</strong>，用于简化 JDBC 开发</p>\n</li>\n<li>\n<p>MyBatis 本事 Apache 的一个开源项目 iBatis，2021 年这个项目由 apache software foundation 迁移到了 google code，并且改名为 MyBatis。2013 年 11 月迁移到 Github</p>\n</li>\n<li>\n<p>官网：<a href=\"https://mybatis.org/mybatis-3/zh/index.html\" target=\"_blank\" rel=\"noopener noreferrer\">https://mybatis.org/mybatis-3/zh/index.html<OutboundLink/></a></p>\n</li>\n<li>\n<p>Github 搜索：<a href=\"https://github.com/search?q=mybatis\" target=\"_blank\" rel=\"noopener noreferrer\">https://github.com/search?q=mybatis<OutboundLink/></a></p>\n</li>\n<li>\n<p>GitHub 源码地址：<a href=\"https://github.com/mybatis/mybatis-3\" target=\"_blank\" rel=\"noopener noreferrer\">https://github.com/mybatis/mybatis-3<OutboundLink/></a></p>\n</li>\n<li>\n<p>Github 源码中文注释：<a href=\"https://github.com/tuguangquan/mybatis\" target=\"_blank\" rel=\"noopener noreferrer\">https://github.com/tuguangquan/mybatis<OutboundLink/></a></p>\n</li>\n<li>\n<p>Maven 仓库：<a href=\"https://mvnrepository.com/\" target=\"_blank\" rel=\"noopener noreferrer\">https://mvnrepository.com/<OutboundLink/></a></p>\n</li>\n<li>\n<p>Maven 依赖</p>\n<!--beforebegin--><div class=\"language-xml line-numbers-mode\"><!--afterbegin--><pre v-pre class=\"language-xml\"><code><span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>dependency</span><span class=\"token punctuation\">></span></span>\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>groupId</span><span class=\"token punctuation\">></span></span>org.mybatis<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>groupId</span><span class=\"token punctuation\">></span></span>\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>artifactId</span><span class=\"token punctuation\">></span></span>mybatis<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>artifactId</span><span class=\"token punctuation\">></span></span>\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>version</span><span class=\"token punctuation\">></span></span>3.5.2<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>version</span><span class=\"token punctuation\">></span></span>\n<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>dependency</span><span class=\"token punctuation\">></span></span>\n</code></pre>\n<div class=\"line-numbers-wrapper\"><span class=\"line-number\">1</span><br><span class=\"line-number\">2</span><br><span class=\"line-number\">3</span><br><span class=\"line-number\">4</span><br><span class=\"line-number\">5</span><br></div><!--beforeend--></div><!--afterend--></li>\n</ul>\n<h3 id=\"持久化\"><a class=\"header-anchor\" href=\"#持久化\">#</a> 持久化</h3>\n<blockquote>\n<p>持久化就是将程序的数据在持久状态和瞬时状态转化的过程</p>\n<p>内存：<strong>断电即丢失</strong></p>\n<p>数据库(JDBC)，io 文件持久化</p>\n</blockquote>\n<p>为什么需要持久化？</p>\n<ul>\n<li>有一些对象，不能让它丢掉</li>\n<li>内存太贵了</li>\n</ul>\n<h3 id=\"持久层\"><a class=\"header-anchor\" href=\"#持久层\">#</a> 持久层</h3>\n<blockquote>\n<p>Dao 层、Service 层、Controller 层。。。</p>\n</blockquote>\n<ul>\n<li>负责将数据保存到<strong>数据库</strong>的那一层代码</li>\n<li>JavaEE 三层架构：表现层、业务层、<strong>持久层</strong></li>\n<li>POJO（Plain Old Java Objects， 普通老式 Java 对象）</li>\n</ul>\n<h3 id=\"框架\"><a class=\"header-anchor\" href=\"#框架\">#</a> 框架</h3>\n<ul>\n<li>框架就是一个<kbd>半成品软件</kbd>，是一套可重用的、通用的、软件基础代码模型</li>\n<li>在框架的基础上构建软件编写更加高效、规范、通用、可扩展</li>\n</ul>\n",
